'''Sergeant Strongstack''' is one of the three sergeants fighting for [[General Graardor]], along with [[Sergeant Grimspike]] and [[Sergeant Steelwill]]. Strongstack uses [[melee]] attacks and attacks by drifting to each player in the room assuming there is more than one.

